package Day1Assignmeent;

public class PaternLooping {

	public void Pattern() {
		// TODO Auto-generated constructor stub
		for (int i = 1; i <= 5; i++) {
			for (int j = 1; j <= 5; j++) {
				System.out.print(i);
			}
			System.out.println();
		}

	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		PaternLooping obj = new PaternLooping();
		obj.Pattern();

	}

}
